import Card from './Card'
import Ribbon from './top-ribbon';
import './home-styling.css'
function Home(){
    return (
        <>
        <Ribbon/>
        <div className='cards-container'>
            {[...Array(9)].map((element,id)=>(<div className='card' key={id}><Card/></div>))}
        </div>
        </>
    )
}
export default Home;
